Legion of Super-Heroes v4 #20 (1991)
Publisher:  DC Comics
Publication Date:  May 15, 1991

Cover by Keith Giffen
Written by Mary Bierbaum and Tom Bierbaum
Pencils by Keith Giffen
Inks by Al Gordon
Colored by Tom McCraw

Rokk Krinn must recount his experience at Venado Bay. Meanwhile, the situation on Earth grows tense, and Legionnaires are sent to help the underground movement there, which is led by the former Legionnaire, Jacques Foccart.

